import { AUTH, LOGOUT } from '../constants/actionTypes';

const authReducers = (state = { authData: null }, action) => {
    switch (action.type) {
        case AUTH:
            console.log(action?.data)
            return state;
        default:
            return state;
    }
};
export default authReducers;
